import React from 'react'

const Footer = () => {

    const footeritems = [
        { id: 1, link: 'FAQ', href: 'https//www.google.com' },
        { id: 1, link: 'FAQ', href: 'https//www.google.com' },
        { id: 1, link: 'FAQ', href: 'https//www.google.com' },
        { id: 1, link: 'FAQ', href: 'https//www.google.com' },
        { id: 1, link: 'FAQ', href: 'https//www.google.com' },
    ]

    return (
        <div className='bg-black  mt-1 h-full'>
            <div className='mx-10 p-10 '>
                <p className='text-white px-6 text-xl'>Questions? Call 000-800-919-1694</p>
            </div>

            <div className='  flex justify-evenly text-white' >
                
                <div className=' flex flex-col' >
                    {
                        footeritems.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>
                
                <div className='   flex flex-col' >
                    {
                        footeritems.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>
                <div className='   flex flex-col' >
                    {
                        footeritems.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>

                
            </div>

            <div>

            </div>
        </div>
    )
}

export default Footer
